import { React, lazy, Suspense } from "react";
import { BrowserRouter, Switch, Route, Routes } from "react-router-dom";
import ComponentLoading from "../components/ComponentLoading";
import PageLoading from "../components/PageLoading";

import {
  Home,
  Login,
  Kategory,
  Markets,
  Market,
  Brend,
  Brends,
  Product,
  Basket,
  Orders,
  Order,
  Favorites,
  Info,
  Address,
  Sargyt,
  Signup,
  Verification,
  FirstPage,
  DiscountProduct,
  MoreSaleProduct,
  Kategories,
  SearchProducts,
  Profile,
} from "../pages/index";

import ScrollIntoView from "./ScrollIntoView";

const PrivateRoute = lazy(() => import("./PrivateRoute"));
const PublicRoute = lazy(() => import("./PublicRoute"));
const PrivateRouteFood = lazy(() => import("./PrivateRouteFood"));
const PublicRouteFood = lazy(() => import("./PublicRouteFood"));
const App = () => {
  return (
    // forceRefresh={true}
    // history={history}
    <BrowserRouter>
      <ScrollIntoView>
        <Suspense fallback={<PageLoading />}>
          <Switch>
            <PublicRoute
              restricted={true}
              component={Home}
              path="/mrt/home"
              exact
            />
            <PublicRoute
              restricted={true}
              component={Kategories}
              path="/mrt/kategories"
              exact
            />
            <PublicRoute
              restricted={true}
              component={Kategory}
              path="/mrt/kategory/:id"
              exact
            />
            <PublicRoute
              restricted={true}
              component={Markets}
              path="/mrt/markets"
              exact
            />
            <PublicRoute
              restricted={true}
              component={Market}
              path="/mrt/market/:id"
              exact
            />
            <PublicRoute
              restricted={true}
              component={Brends}
              path="/mrt/brends"
              exact
            />
            <PublicRoute
              restricted={true}
              component={Brend}
              path="/mrt/brend/:id"
              exact
            />
            <PublicRoute
              restricted={true}
              component={Product}
              path="/mrt/product/:id"
              exact
            />
            <PublicRoute
              restricted={true}
              component={SearchProducts}
              path="/mrt/search/:product_name"
              exact
            />
            <PublicRoute
              restricted={true}
              component={DiscountProduct}
              path="/mrt/discount"
              exact
            />
            <PublicRoute
              restricted={true}
              component={MoreSaleProduct}
              path="/mrt/moreSale"
              exact
            />
            <PublicRoute
              restricted={true}
              component={Basket}
              path="/mrt/basket"
              exact
            />
            <PublicRoute
              restricted={true}
              component={Sargyt}
              path="/mrt/sargyt"
              exact
            />
            <PrivateRoute
              restricted={true}
              component={Orders}
              path="/mrt/profile/orders"
              exact
            />
            <PrivateRoute
              restricted={true}
              component={Order}
              path="/mrt/profile/orders/:id"
              exact
            />
            <PrivateRoute
              restricted={true}
              component={Favorites}
              path="/mrt/profile/favorites"
              exact
            />
            <PrivateRoute
              restricted={true}
              component={Info}
              path="/mrt/profile/info"
              exact
            />{" "}
            <PrivateRoute
              restricted={true}
              component={Profile}
              path="/mrt/profile"
              exact
            />
            <PrivateRoute
              restricted={true}
              component={Address}
              path="/mrt/profile/address"
              exact
            />
            {/* Global */}
            <Route restricted={true} component={FirstPage} path="/" exact />
            <Route restricted={true} component={Login} path="/login" exact />
            <Route restricted={true} component={Signup} path="/signup" exact />
            <Route
              restricted={true}
              component={Verification}
              path="/verification/:phone"
              exact
            />
            <PublicRoute component={Home} path="*" />
            {/* <Route path="*" component={Home} /> */}
          </Switch>
        </Suspense>
      </ScrollIntoView>
    </BrowserRouter>
  );
};

export default App;
